import React, { useState } from "react";
import RegisterPage from "./pages/RegisterPage";
import PlayPage from "./pages/PlayPage";
import { register, applyReferral, awardWin, getUser } from "./services/api";

function App() {
  const [user, setUser] = useState(null);
  const [referralInput, setReferralInput] = useState("");
  const [referralError, setReferralError] = useState("");

  // Register a new user
  async function handleRegister(payload) {
    try {
      const res = await register(payload);
      setUser(res.user);
    } catch (err) {
      console.log("Registration error:", err);
    }
  }

  // Apply referral code
  async function handleApplyReferral() {
    if (!referralInput) {
      setReferralError("Please enter a referral code");
      return;
    }

    try {
      const res = await applyReferral({
        userId: user._id,
        referralCode: referralInput,
      });

      // Update coins from backend response
      setUser({ ...user, coins: res.newBalance });
      setReferralError("");

    } catch (err) {
      const msg = err.response?.data?.error || "Failed to apply referral";
      setReferralError(msg);
    }
  }

  // Award coins when user wins
  async function handleWinReward() {
    try {
      const res = await awardWin({ userId: user._id });
      setUser({ ...user, coins: res.newBalance });
    } catch (err) {
      console.log("Win reward error:", err);
    }
  }

  return (
    <div className="container">

      {/* LEFT PANEL */}
      <div className="left-panel">
        <h1>Refer & Earn — TicTacToe Demo</h1>

        {!user ? (
          <>
            <h2>Create account</h2>
            <RegisterPage onRegister={handleRegister} />
          </>
        ) : (
          <>
            <h2>Welcome, {user.name}</h2>
            <p><b>Your referral code:</b> {user.referralCode}</p>
            <p><b>Coins:</b> {user.coins}</p>

            <hr />

            <h2>Profile</h2>
            <p><b>Name:</b> {user.name}</p>
            <p><b>Email:</b> {user.email}</p>
            <p><b>Referral code:</b> {user.referralCode}</p>
            <p><b>Coins:</b> {user.coins}</p>

            <hr />

            <h2>Apply a referral code</h2>
            <input
              placeholder="Referral Code"
              value={referralInput}
              onChange={(e) => setReferralInput(e.target.value)}
            />
            <br />
            <button onClick={handleApplyReferral}>Apply</button>

            {referralError && (
              <div className="error">{referralError}</div>
            )}
          </>
        )}
      </div>

      {/* RIGHT PANEL — TicTacToe */}
      <div className="ttt-container">
        <h2>Tic-Tac-Toe</h2>

        {user ? (
          <PlayPage onWinReward={handleWinReward} />
        ) : (
          <p>Please register to play.</p>
        )}
      </div>
    </div>
  );
}

export default App;
